import Avocado from "./Component/avocado";
import Milkshake from "./Component/milkshake";
import RecipeList from "./Component/RecipeList";


class App extends Component {
  render() {
  return (
    <div className="App">
    <Navbar />
    <div style={{display:"flex"}}>
        <Avocado
          title="Avocado Toast"
          ingredients={['Pasta', 'Flour', 'Water']}
          instructions="Mix ingredients"
          img="pasta.jpg"
        />

        <Milkshake
          title="Milkshake"
          ingredients={['Pasta', 'Flour', 'Water']}
          instructions="Mix ingredients"
          img="milkshake.jpg"
        />

      <Recipe 
      title="Spaghetti" 
      ingredients ={['Pasta', 'Flour', 'Water']}
      instructions="Mix ingredients"
      img="spaghetti.jpg"
       />
      </div>
    </div>
   );
  } 
}


export default App;
